import React from "react";
import "./Cart.scss";

const Cart = () => {
	const data = [
		{
			id: 1,
			img: "https://images.pexels.com/photos/1972115/pexels-photo-1972115.jpeg?auto=compress&cs=tinysrgb&w=1600",
			img2: "https://images.pexels.com/photos/1163194/pexels-photo-1163194.jpeg?auto=compress&cs=tinysrgb&w=1600",
			title: "Long Sleeve Graphic T-shirt",
			isNew: true,
			oldPrice: 19,
			price: 12,
			desc: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Est eveniet deleniti eius cupiditate. Dignissimos fugiat eveniet hic rem quod, culpa temporibus nostrum provident beatae ipsa similique est totam aut ab.",
		},
		{
			id: 2,
			img: "https://images.pexels.com/photos/1759622/pexels-photo-1759622.jpeg?auto=compress&cs=tinysrgb&w=1600",
			title: "Long Sleeve Graphic T-shirt",
			isNew: true,
			oldPrice: 19,
			price: 12,
			desc: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Est eveniet deleniti eius cupiditate. Dignissimos fugiat eveniet hic rem quod, culpa temporibus nostrum provident beatae ipsa similique est totam aut ab.",
		},
		{
			id: 3,
			img: "https://images.pexels.com/photos/1457983/pexels-photo-1457983.jpeg?auto=compress&cs=tinysrgb&w=1600",
			title: "Skirt",
			oldPrice: 19,
			price: 12,
			desc: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Est eveniet deleniti eius cupiditate. Dignissimos fugiat eveniet hic rem quod, culpa temporibus nostrum provident beatae ipsa similique est totam aut ab.",
		},
		{
			id: 4,
			img: "https://images.pexels.com/photos/2065200/pexels-photo-2065200.jpeg?auto=compress&cs=tinysrgb&w=1600",
			title: "Hat",
			oldPrice: 19,
			price: 12,
			desc: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Est eveniet deleniti eius cupiditate. Dignissimos fugiat eveniet hic rem quod, culpa temporibus nostrum provident beatae ipsa similique est totam aut ab.",
		},
	];
	return (
		<div>
			<h1>Products in your Cart</h1>
			{data.map((item) => {
				return (
					<div className="item" key={item.id}>
						<img src={item.img} alt="" />
						<div className="details">
							<h1>{item.title}</h1>
							<p>{item.desc.substring(0, 70)}</p>
							<div className="price">1 x ${item.price}</div>
						</div>
					</div>
				);
			})}
		</div>
	);
};

export default Cart;
